import { useLocation } from "react-router-dom";

import RecordingVideo from "../components/RecordingVideo";

export default function Game(){
    const location = useLocation();

    const { team, players } = location.state || []; // Ensure safe destructuring

    const teamName = team.properties?.Name.title[0].plain_text;

    const playerBackName = players.properties?.Name.title[0].plain_text;
    const playerName = players.properties?.first_name.rich_text[0].plain_text + " " + players.properties?.last_name.rich_text[0].plain_text;

    console.log(players);
    return(
        <div className = "page">
            <h1>{ teamName }</h1>
            <p>Start Recording Game for { teamName }</p>

            {/* <VideoRecorder/> */}

            <RecordingVideo/>


            {/* SIGN UP */}
            { players.map( ( item, index ) => (
                <div key = { index }>
                    <p>{ playerBackName }</p>
                    <p>{ playerName }</p>
                </div>
            ))}


        </div>
    )
}
